import styled from "styled-components";


export const Tbody = styled.tbody`
    height: 500px;
    overflow-y: scroll;
    cursor:pointer;
`

export const TableProducts = styled.table `
    @media(max-width: 767px){
    height: 150px;
    font-size:12px;
    margin-left:50px;
}

`
